import React, { Component } from 'react';


class Text extends Component{
    constructor(name,job){
        this.name = name;
        this.job = job;
    }
    render(){
        return (
            <div>
                {
                     Text('sultan' ,'web div')
                }
                <p>{`مرحباً يا ${this.name} وظيفتك هي ${this.job}`}</p>
            </div>
        )
    }
}
export default Text;
